import React from 'react';
import Modal from 'react-modal';



const BookModal = (props) => {

    return (
        <div>
            <Modal
                isOpen={props.isOpen}
                onRequestClose={props.closeModal}
                contentLabel="Book Modal"
            >
                <h1> New Book </h1>
            </Modal>
        </div>
    )

}

export default BookModal;
